import { Link } from 'react-router-dom'
import { auth } from '../config/firebase'
export const Navbar = () => {

    return (
        <div>
        <Link to="/"> HOME </Link>
        <Link to="/login"> LOGIN </Link>

        <div>
            <p> {auth.currentUser}</p>
        </div>
        </div>
    )
}
